DROP SCHEMA IF EXISTS fake CASCADE;

CREATE SCHEMA fake;

CREATE TABLE fake.names (
    id SERIAL PRIMARY KEY,
    name TEXT
);

CREATE TABLE fake.surnames (
    id SERIAL PRIMARY KEY,
    surname TEXT
);

CREATE TABLE fake.sentences (
    id SERIAL PRIMARY KEY,
    sentence TEXT
);

CREATE FUNCTION fake.rand_int(min INT, max INT) RETURNS INT AS $EOFCODE$
BEGIN
  RETURN floor(RANDOM() * (max - min)) + min;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.rand_real(min REAL, max REAL) RETURNS REAL AS $EOFCODE$
BEGIN
  RETURN RANDOM() * (max - min) + min;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.birthday() RETURNS DATE AS $EOFCODE$
BEGIN
  RETURN now()::date - fake.rand_int(0, 365 * 70);
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.rand_interval(future BOOLEAN, units TEXT, min INT, max INT) RETURNS INTERVAL AS $EOFCODE$
BEGIN
  IF (future) THEN
    RETURN (fake.rand_int(min, max) || ' ' || units)::INTERVAL;
  ELSE
    RETURN (fake.rand_int(min, max) || ' ' || units)::INTERVAL;
  END IF;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.rand_timestamp(future BOOLEAN, min INT, max INT, from_date TIMESTAMP DEFAULT now(), units TEXT DEFAULT 'days') RETURNS TIMESTAMP AS $EOFCODE$
BEGIN
  IF (future) THEN
    RETURN from_date + fake.rand_interval(future, units, min, max);
  ELSE
    RETURN from_date - fake.rand_interval(future, units, min, max);
  END IF;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.gender() RETURNS TEXT AS $EOFCODE$
BEGIN
  RETURN (
      CASE (RANDOM() * 1)::INT
        WHEN 0 THEN 'Male'
        WHEN 1 THEN 'Female'
      END
  );
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.pos() RETURNS REAL AS $EOFCODE$
BEGIN
  RETURN fake.rand_real(-90.0, 90.0);
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.name() RETURNS TEXT AS $EOFCODE$
    SELECT name FROM fake.names WHERE id = (SELECT fake.rand_int(1, 5157));
$EOFCODE$ LANGUAGE sql;

CREATE FUNCTION fake.surname() RETURNS TEXT AS $EOFCODE$
    SELECT surname FROM fake.surnames WHERE id = (SELECT fake.rand_int(1, 16328));
$EOFCODE$ LANGUAGE sql;

CREATE FUNCTION fake.sentence() RETURNS TEXT AS $EOFCODE$
    SELECT sentence FROM fake.sentences WHERE id = (SELECT fake.rand_int(1, 1000));
$EOFCODE$ LANGUAGE sql;

CREATE FUNCTION fake.rand_id_from(from_table TEXT, min INT, max INT, retries INT DEFAULT 1000) RETURNS INT AS $EOFCODE$
DECLARE
    num INT;
BEGIN
    FOR i IN 1..retries
    LOOP
        EXECUTE 'SELECT id FROM ' || from_table || ' WHERE id = ' || (SELECT fake.rand_int(min, max)) || '' INTO num;
        IF (num IS NOT NULL) THEN
            RETURN num;
         END IF;
    END LOOP;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.paragraph(count INT) RETURNS TEXT AS $EOFCODE$
DECLARE
    i INT;
    txt TEXT;
    buff TEXT;
BEGIN
    FOR i IN 1..COUNT
    LOOP
        buff = (SELECT sentence FROM fake.sentences WHERE id = (SELECT fake.rand_int(1, 1000)));
        txt = concat(txt, ' ', buff);
    END LOOP;
    RETURN txt;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

CREATE FUNCTION fake.biometrics(trainings_count INT, min_metrics_per_training INT, max_metrics_per_training INT) RETURNS INT AS $EOFCODE$
DECLARE
    i INT;
    j INT;
    training_id INT;
    metrics_count INT;
    training_start_date TIMESTAMP;
    training_duration INTERVAL;
    distance_counter REAL = 0.0;
    stpes_counter INT = 0;
    calories_counter INT = 0;
BEGIN
    FOR i IN 1..trainings_count
    LOOP
        metrics_count = fake.rand_int(min_metrics_per_training, max_metrics_per_training);
        training_id = fake.rand_id_from('trainings', 1, (SELECT COUNT(*) FROM trainings)::INT);
        training_start_date = (SELECT start_date FROM trainings WHERE id = training_id);
        training_duration = (SELECT duration FROM trainings WHERE id = training_id);

        distance_counter = 0.0;
        stpes_counter = 0;
        calories_counter = 0;

        FOR j IN 1..metrics_count
        LOOP
            distance_counter = distance_counter + fake.rand_real(0.0, 100.0);
            stpes_counter = stpes_counter + fake.rand_int(0, 1000);
            calories_counter = calories_counter + fake.rand_int(0, 100);
            INSERT INTO biometrics (training, "date", heart_rate, calories, elevation_gain, distance, steps, latitude, longitude)
            SELECT
                training_id,
                fake.rand_timestamp(false, 1, EXTRACT(SECONDS FROM training_duration)::INT, training_start_date, 'seconds'),
                fake.rand_int(50, 220),
                calories_counter,
                fake.rand_int(-50, 50),
                distance_counter,
                stpes_counter,
                fake.pos(),
                fake.pos();
        END LOOP;
    END LOOP;
    RETURN 0;
END;
$EOFCODE$ LANGUAGE plpgsql VOLATILE;

