INSERT INTO users (name, surname, gender, birthday)
SELECT fake.name(), fake.surname(), fake.gender(), fake.birthday()
FROM generate_series(1, 1);

INSERT INTO users_x_followers ("user", follower)
SELECT
    fake.rand_id_from('users', 1, (SELECT COUNT(*) FROM users)::INT),
    fake.rand_id_from('users', 1, (SELECT COUNT(*) FROM users)::INT)
FROM generate_series(1, 1);

INSERT INTO posts (author, title, subtitle, "date")
SELECT
    fake.rand_id_from('users', 1, (SELECT COUNT(*) FROM users)::INT),
    fake.paragraph(1),
    fake.paragraph(4),
    fake.rand_timestamp(false, 1, 365 * 3)
FROM generate_series(1, 1);

INSERT INTO likes_x_posts (like_author, post)
SELECT
    fake.rand_id_from('users', 1, (SELECT COUNT(*) FROM users)::INT),
    fake.rand_id_from('posts', 1, (SELECT COUNT(*) FROM posts)::INT)
FROM generate_series(1, 1);

INSERT INTO events (author, sport_type, "date", title, subtitle, start_date, end_date, latitude, longitude)
SELECT
    fake.rand_id_from('users', 1, (SELECT COUNT(*) FROM users)::INT),
    fake.rand_id_from('sport_types', 1, (SELECT COUNT(*) FROM sport_types)::INT),
    fake.rand_timestamp(true, 1, 365),
    fake.paragraph(1),
    fake.paragraph(6),
    fake.rand_timestamp(true, 1, 20),
    fake.rand_timestamp(true, 21, 365),
    fake.pos(),
    fake.pos()
FROM generate_series(1, 1);

INSERT INTO subscribers_x_events (subscriber, event)
SELECT
    fake.rand_id_from('users', 1, (SELECT COUNT(*) FROM users)::INT),
    fake.rand_id_from('events', 1, (SELECT COUNT(*) FROM events)::INT)
FROM generate_series(1, 1);

INSERT INTO trainings (author, title, start_date, duration, sport_type)
SELECT
    fake.rand_id_from('users', 1, (SELECT COUNT(*) FROM users)::INT),
    fake.paragraph(1),
    fake.rand_timestamp(false, 1, 365),
    fake.rand_interval(false, 'seconds', 1, 60 * 60 * 12),
    fake.rand_id_from('sport_types', 1, (SELECT COUNT(*) FROM sport_types)::INT)
FROM generate_series(1, 1);

SELECT fake.biometrics(10, 5, 100);

